import React from "react";

export default function FilterActivity(props){
    return (
        <div>
           { 
           <select>
                    <option value="All">Todos</option>
                    {
                        props.activities?.map(el => (
                            <option value={el.name} key={el.name}>
                                {el.name}
                            </option>
                        ))
                    }
                    
                </select>}
        </div>
    )
}
